    return (

        events.map((event, index) => (
            <React.Fragment key={event.id}>
                <h2>{index + 1} - {event.title}</h2>
                <button onClick={() => handleClick(event.id)}>delete event</button>
            </React.Fragment>))

    )


}

export default EventList;
